// Imports: Dependencies
import { combineReducers } from 'redux';// Imports: Reducers
import AuthReducer from './AuthReducer';

// Redux: Root Reducer
const rootReducer = combineReducers({
  AuthReducer: AuthReducer,
});// Exports
export default rootReducer;
